                    // Student Pays Fees to the Management //

contract StudentPaysFee{
                                        //  Variables //

    address managementAddress;

                                        // Mappings //

    mapping(uint => uint)  public  studentPaymentMapping;





                                    //   Events     //

    event feesPaid(string message, uint amount);
    event feeWithdrawed(string message, uint amount);





    constructor() public{
        managementAddress = msg.sender;    
    }
                                    //  Modifiers //


    modifier onlyManagement{
        require(managementAddress == msg.sender);
        _;
    }

    modifier minimumBalance{
        require(address(this).balance > 0);
        _;
    }

                        // Student Function #2 //

    function feePayment(uint _roll) public payable {
        studentPaymentMapping[_roll] += msg.value;
        emit feesPaid("Payment completed", msg.value);
    }

                            // Management Function #5 //

    function studentFeeDetails(uint _roll) public onlyManagement view returns (uint _rollNumber,uint _feePayed){
        _rollNumber=_roll;
        _feePayed = studentPaymentMapping[_roll];


    }
                            //  Management Function #4 //

    function feeWithdraw() public onlyManagement minimumBalance {
        emit feeWithdrawed("Fees Withdrawed", address(this).balance);
        msg.sender.transfer(address(this).balance);
        emit feeWithdrawed("Balance in contract", address(this).balance);
    }

                            //  Management Function #3 //

    function managementContractBalance() public view onlyManagement returns(uint _balance) {
        _balance = address(this).balance;
    }

}



